import "./App.css";
import useGoogleCharts from "./useGoogleCharts";
import PerformanceTimeline from "./PerformanceTimeline";
import { Multiselect } from "multiselect-react-dropdown";
import { useState } from "react";

function App() {
  const google = useGoogleCharts();
  const [filter, setFilter] = useState(types);
  const types = [
    { name: "resource", id: 1 },
    { name: "mark", id: 2 },
    { name: "measure", id: 3 },
    { name: "paint", id: 4 },
  ];

  function onSelect(selectedList, _selectedItem) {
    setFilter(selectedList);
  }
  function onRemove(selectedList, _removedItem) {
    setFilter(selectedList);
  }

  return (
    <>
      <Multiselect
        options={types} // Options to display in the dropdown
        selectedValues={types} // Preselected value to persist in dropdown
        onSelect={onSelect} // Function will trigger on select event
        onRemove={onRemove} // Function will trigger on remove event
        displayValue="name" // Property name to display in the dropdown options
      />
      <PerformanceTimeline google={google} filter={filter} />
    </>
  );
}

export default App;

const onSelect = (selectedList, selectedItem) => {};
